items.description:
State of the rectifier module. It is an enumeration type:
1, the rectifier module is in the normal state;
2, a fault occurs on the rectifier module;
3, automatic protection of the rectifier module;
4, communication of the rectifier module fails;
5, the rectifier module is shut down;
6, the rectifier module is invalid;
7, this rectifier is not configured;
8, this rectifier is ac off;
9, this rectifier is rectLost;
254, rectifier alarm resume;
255, rectifier operation status unknown.

